import React from 'react';

import './heroBanner.css'

import { Jumbotron, Button,Row,Col } from "react-bootstrap";

function HeroBanner() {
    return (
      <div className="container mt-5">
        {/* <div className="row"> */}
        <Row>
          {/* <div className="col-6"> */}
          <Col xs={12} md={6}>
            <Jumbotron>
              <h1 className="hb_h1">HELLO</h1>
              <h2 className="hb_h2">Welcome to Liberty!</h2>
              <p className="hb_p">
                A Defi stablecoin ecosystem dedicated to safeguarding the
                liberty of our community and society.
              </p>
              <p>
                <Button className="btn-custom" variant="primary">
                  CONNECT WALLET
                </Button>
              </p>
            </Jumbotron>
          </Col>
          <Col xs={12} md={6}>
            <div>{/* <img src="./Images/Astronaut.svg"></img> */}</div>
          </Col>
        </Row>
      </div>
    );
};
export default HeroBanner;
